define(function(require,exports,module){"use strict";var Library=require("./CDNLibrary").Library;function LibraryList(){var libraries=[],libraryNames=[];function getLibrary(cdnLibrary){for(var i=0;i<libraries.length;i++){if(libraries[i].matches(cdnLibrary.name)){return libraries[i]}}if(typeof cdnLibrary.mainfile==="undefined"||cdnLibrary.mainfile.length===0){return null}else{libraries.push(new Library(cdnLibrary.name));return libraries[libraries.length-1]}}function addCDN(name,cdnLibraries){cdnLibraries.forEach(function(lib){var library=getLibrary(lib);if(library){library.addCDNInfo(name,lib)}});libraries.sort(Library.compareIds);updateLibraryNames()}function updateLibraryNames(){libraryNames={};libraries.forEach(function(library){var type=library.getLibraryType();if(!libraryNames.hasOwnProperty(type)){libraryNames[type]=[]}libraryNames[type].push(library.getName())})}function findById(id){for(var i=0;i<libraries.length;i++){var library=libraries[i];if(library.getId()===id){return library}}return null}function findByName(name){for(var i=0;i<libraries.length;i++){var library=libraries[i];if(library.getName()===name){return library}}return null}function getLibraryNamesByType(type){return libraryNames[type]}return{addCDN:addCDN,findById:findById,findByName:findByName,getLibraryNamesByType:getLibraryNamesByType}}exports.LibraryList=LibraryList});